import React from 'react';
import styled from 'styled-components';

type LogoProps = {
    style: {},
    label: string
}

const Figure = styled.figure`
    background: 50% 50% no-repeat;
    background-size: cover;
`;

const Logo: React.FC<LogoProps> = (props) => {
    return <Figure style={props.style}>
    </Figure>
};

export default Logo;
